import React from 'react';
import styled from 'styled-components';
import CelestiaLogo from '../assets/CelestiaLogo.svg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleUp, faAngleDown } from '@fortawesome/free-solid-svg-icons';

const Container = styled.header`
    display: flex; 
    padding: 1em;
    align-items: center;
    justify-content: space-between;
`

const Logo = styled.img`

`

const Navigation = styled.nav`

`

const Lists = styled.ul`
    list-style: none;
    display: flex;
`

const List = styled.li`
    display: flex;
    align-item: flex-end;
`

function Heading() {
  return (
    <Container>
        <Logo src={CelestiaLogo} alt='Celestia Logo'/>
        <Navigation>
            <Lists>
                <List>Learn <FontAwesomeIcon icon={faAngleDown}/></List>
                <List>Build <FontAwesomeIcon icon={faAngleDown}/></List>
                <List>Community <FontAwesomeIcon icon={faAngleDown}/></List>
            </Lists>
        </Navigation>
    </Container>
  )
}

export default Heading
